import React from 'react';
import styled from 'styled-components';
import {Vec2} from '../utility';

type CellProps = {
    fill: boolean;
    position: Vec2;
    // className?: string;
};

// const Wrapper = styled.div<CellProps>`
//     border: 2px solid red;
//     color: wheat;
// `;

const Cell: React.FC<CellProps> = (props) => {
    // return <Wrapper fill={props.fill} className={props.className} />;

    if (props.fill) {
        return (
            <span
                style={{backgroundColor: 'red', width: '10px', height: '10px'}}>
                {props.position.row}, {props.position.col}
            </span>
        );
    } else {
        return (
            <span>
                {props.position.row}, {props.position.col}
            </span>
        );
    }
};

export default Cell;
